import React from 'react'
import styles from './CompletedItem.module.css'

export default function CompletedItem({ course, schedulePlacement }) {
  return (
    <div className={styles.mainComponent}>
        <div className={styles.courseTitle}>{course}</div>
        <div className={styles.schedulePlacement}>in {schedulePlacement.season} 2024</div>
    </div>
  )
}
